export class sprayManager{
    constructor(){

    }

    checkHumTemp() {
        let hum = Number(props.settings.humidity)
        let temp = Number(props.settings.temperature)
        const temp_hum_table = {
            90: {good: [18, 33], middle: [33, 36], bad: [36, 80]},
            80: {good: [18, 33], middle: [33, 36], bad: [36, 60]},
            70: {good: [18, 33], middle: [33, 36], bad: [36, 80]},
            60: {good: [18, 27], middle: [27, 36], bad: [36, 80]},
            50: {good: [], middle: [18, 30], bad: [30, 80]},
            40: {good: [], middle: [18, 24], bad: [24, 80]},
            30: {good: [], middle: [18, 24], bad: [24, 80]},
        }
        let hum_values = temp_hum_table[hum]
        let result = "undef"
        Object.keys(hum_values).forEach(key => {
            let range = hum_values[key]
            if (temp >= range[0] && temp < range[1]){
                result = key
            }
        })
        return result
    }

}
